import React from "react";
import {NavLink,BrowserRouter as Router} from "react-router-dom";
import "./Navigation.css";
function Navbar(){
    return (
        <div className="Navbar">
            <li>
                {/* <Router> */}
                        <li><span id="l1">MONEY</span><span id="l2">MATTERS</span></li>
                        <li><NavLink to="./Home" className="text-link">HOME</NavLink></li>
                        <li><NavLink to="./Login" className="text-link">LOGIN</NavLink></li>
                        <li><NavLink to="./Register" className="text-link">REGISTER</NavLink></li>
                        <li><NavLink to="./About" className="text-link">ABOUT</NavLink></li>
                {/* <NavLink to="/src/Navbar.jsx" className="text-link"><span id="l1">Money </span><span id="l2">Matters</span></NavLink> */}
                {/* </Router> */}
            </li>
        </div>
    );
}



export default Navbar;
